import { Button } from "lively.morphic/components/buttons.js";
import { loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";

export default class InstructionsButton extends Button {
  async trigger() {
    super.trigger()
    var target = this.owner.owner.submorphs.filter(function(ea){
      return ea.name == 'visjsMorph'
    })[0]

    target.getInstructions(async (instructions)=>{
       var htmlInstructions = await loadObjectFromPartsbinFolder("html-morph");
       htmlInstructions.openInWindow();
       htmlInstructions.name = "Instructions"
       htmlInstructions.clipMode = "auto"
       htmlInstructions.html = instructions       
    })
  }
}

