import { HTMLMorph } from "lively.morphic";
import * as vis from "https://lively-web.org/users/MattH/uploads/vis.js"
import { deepCopy } from "lively.lang/object.js";

import WebDAVResource from "lively.resources/src/http-resource.js";
import { loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";

export default class VisjsMorph extends HTMLMorph {
  onLoad(){
  this.loadGraph();
  }
  async loadGraph() {     
      this.viscanvasId = 'vis-canvas-' + this.id
      var htmlString = '<div style="height:100%" id="' + this.viscanvasId + '"/><//div>'
      this.html = htmlString;
      var DataObject = await this.getData(),
      nodeArray = DataObject.nodes,
      edgeArray = DataObject.edges     
      var nodes = new vis.DataSet(nodeArray)  
      var edges = new vis.DataSet(edgeArray)
      console.log(DataObject)
  var container = this.domNode.querySelector('#' + this.viscanvasId)
  this.data = {
    nodes: nodes,
    edges: edges
  };

  this.options = {
  interaction:{hover:true},

  manipulation: {
    addEdge: this.addEdge
  },

  physics:{
    enabled: false,
    repulsion: {
      centralGravity: 0.5,
      springLength: 200,
      springConstant: 0.05,
      nodeDistance: 100,
      damping: 0.09
    },
    maxVelocity: 50,
    minVelocity: 0.1,
    solver: 'repulsion',
    stabilization: {
      enabled: true,
      iterations: 2500,
      updateInterval: 10,
      onlyDynamicEdges: false,
      fit: true
    },
        timestep: 0.5,
        adaptiveTimestep: true
  },
  layout: {
    hierarchical: {
      enabled:false
    },
    randomSeed: 1,
    improvedLayout:true
  }
}


  this.network = await new vis.Network(container, this.data, this.options);

  this.network.fit()

  this.options.physics.enabled = true
  this.network.setOptions(this.options)

  this.singleClickListener(this)
  this.doubleClickListener(this)
  this.longClickListener(this)
  this.hoverListener(this)
  this.blurListener(this)
  this.rightClickListener(this)
  this.dragStartListener(this)
  this.dragListener(this)
  this.dragEndListener(this)

  }
   singleClickListener(self) {
    var network = this.network;
    var hand = $world.hands[0]
    network.on("click", function (params) {
      var node = params.nodes[0]
      if(!node){
        return
      }
    })
  }
  showTooltip(obj, blur) {
    var container = this.domNode.querySelector('#' + this.viscanvasId)
    var nodeDelete = this.domNode.querySelector('#tooltipNode');
    if(nodeDelete){
       container.removeChild(nodeDelete);   
       if(blur){
           return;
       }
    }
    var tt = document.createElement("div");
    tt.setAttribute("id", "tooltipNode");
    tt.setAttribute("class", "tooltipNode");
    this.setTTStyle(tt)

    var title = ( obj.tt == undefined ) ? ""  : obj.tt;
    tt.innerHTML = title;
    container.appendChild(tt);
  }
  hoverListener(self) {
     this.network.on("hoverNode", function (params) {         
        var HOVER_SIZE_ICON = 50;
        var nodeId = params.node;
        var node = self.data.nodes.get(String(nodeId).split('_cluster')[0]);//If cluster, display inner node tooltip
        self.showTooltip(node); 

    });
  }  
  setTTStyle(tt) {  
    tt.setAttribute("style","position: absolute;\
	   text-align: left;\
	   top: 5%;\
    left: 20px;\
    background-color: #FFFFFF;\
    font-family: Roboto, Ubuntu, Verdana, Arial;\
    font-size: 0.65em;\
    padding: 5px;\
    border-radius: 5px;\
    border: solid 4px;\
    min-width: 0px;\
    max-width: 50%;\
    min-height: 0px;\
    max-height: 80%;")
  }
  blurListener(self){
    var network = this.network;
    network.on("blurNode", function (params) {      
      var node = self.data.nodes.get(params.node);
      self.hideTooltip();
    });
  }
  hideTooltip(){
    var container = this.domNode.querySelector('#' + this.viscanvasId)
    var nodeDelete = this.domNode.querySelector('#tooltipNode');
    if(nodeDelete){
        container.removeChild(nodeDelete);    
    }
  }
  longClickListener(self) {
    var network = this.network;
    network.on("hold", function (params) {      
      var node = params.nodes[0]
      if(node){
        //duplicate node here
        var nodeObj = self.data.nodes.get(node)
        var tempNode = deepCopy(nodeObj)
        tempNode.label = nodeObj.label + '_1'
        tempNode.id = nodeObj.id + '_1'
        self.data.nodes.update(tempNode)
      } else {
        //create node here
        var nodeCount = self.data.nodes.length + 1
        var {x,y} = params.pointer.canvas
        var nodeObj = {id: nodeCount, label: 'Node ' + nodeCount, tt: 'Node ' + nodeCount, x: x, y: y}
        console.log(params)
        self.data.nodes.update(nodeObj)
      }

    })
  }
  doubleClickListener(self) {
    var network = this.network;
    network.on("doubleClick", async function (params) {

        var nodeId = params.nodes[0]
        var node = self.data.nodes.get(nodeId)

        if (self.network.isCluster(nodeId) == true){
        //If selection is cluster
          console.log(nodeId)
          self.network.openCluster(nodeId);
        } else {
        //If selection is not cluster
        // node.group is the value this item will cluster based on
          if (node.group){
            var group = node.group
            var clusterOptionsByData = self.getClusterByData(self,nodeId,node, group)          
            self.network.cluster( clusterOptionsByData);
          }
          return
        }


    })
  }
  rightClickListener(self) {
    var network = this.network;
    network.on("oncontext", function (params) { })
  }
  dragStartListener(self){
    var network = this.network;
    network.on("dragStart", function (params) {

    })
  }
  dragListener(self){
    var network = this.network;
    network.on("dragging", function (params) { })
  }
  dragEndListener(self){
    var network = this.network;
    network.on("dragEnd", function (params) {

    })
  }
  addEdge(data,callback) {
    $world.get('cancelButton').visible = false    
    callback(data);

  }
  addNode(data,callback){
  }
  onResize(evt) {
    console.log(evt)
  }
  makeTextField(k,v) {
    console.log({k,v})
  }
  async getData() {
      var nodes =[
      {id: 1, label: "Node 1", tt: "Node 1", group: 1},
      {id: 2, label: "Node 2", tt: "Node 2", group: 1},
      {id: 3, label: "Node 3", tt: "Node 3", group: 2},
      {id: 4, label: "Node 4", tt: "Node 4", group: 2},
      {id: 5, label: "Node 5", tt: "Node 5", group: 3},
      {id: 6, label: "Node 6", tt: "Node 6", group: 3},
      {id: 7, label: "Node 7", tt: "Node 7", group: 4}
      ]
      var edges =[
      {from: 1, to: 2},
      {from: 2, to: 3},
      {from: 3, to: 4},
      {from: 5, to: 4},
      {from: 6, to: 4},
      {from: 7, to: 4},
      {from: 7, to: 2},
      {from: 6, to: 2}
      ]
      return {nodes,edges}

    }


  getClusterByData(self,nodeId,node,group) {
    return {
              joinCondition:  function(childOptions){
                return (childOptions.group == group)},
              clusterNodeProperties: {
                id: node.id + '_cluster',
                label: 'Cluster of Grouping: \n' + group,
                tt: 'Cluster of Grouping: <br>' + group,
                borderWidth:3,                
                image: node.image,
                shape: node.shape
                }
          };
  }

  async getInstructions(cb) {
    var instructionText = await new WebDAVResource('https://raw.githubusercontent.com/m-hemmings/MiscFiles/master/lively.next/instructions_visjs.html').read()    
    cb(String(instructionText))
  }
}

